  public Object wdInvokeEventHandler(String handlerName, IWDCustomEvent event)
    throws NoSuchMethodException {
    
    logger.pathT("entering: wdInvokeEventHandler", new Object[] { handlerName } );
    try {
      if("onPlugentradabaja".equals(handlerName)) {

        delegate.onPlugentradabaja(event );
        return null;
      }
      if("onActioneliminar".equals(handlerName)) {

        delegate.onActioneliminar(event );
        return null;
      }
      if("onActionrechazar".equals(handlerName)) {

        delegate.onActionrechazar(event );
        return null;
      }
      if("onActionverificar".equals(handlerName)) {

        delegate.onActionverificar(event );
        return null;
      }
      if("onActionadjuntar".equals(handlerName)) {

        delegate.onActionadjuntar(event );
        return null;
      }
      if("onPlugentradabaja_adj".equals(handlerName)) {

        delegate.onPlugentradabaja_adj(event );
        return null;
      }
      if("onActionmotivo_otro".equals(handlerName)) {

        delegate.onActionmotivo_otro(event );
        return null;
      }
      if("Inicializar".equals(handlerName)) {

        delegate.Inicializar(event );
        return null;
      }
      if("Finalizar".equals(handlerName)) {

        delegate.Finalizar(event );
        return null;
      }
      throw new NoSuchMethodException("Eventhandler " + handlerName + " not found for event " + event.getName());
    } finally {
      logger.pathT("exiting: wdInvokeEventHandler"); 
    }
  }

